      <img
        className="profile-photo"
        src={image3}
        alt={"Carlie Anglemire"}
        height={"400px"}
      />
      <img
        className="profile-photo"
        src={image4}
        alt={"Carlie Anglemire"}
        height={"400px"}
      />
      <img
        className="profile-photo"
        src={image5}
        alt={"Carlie Anglemire"}
        height={"400px"}
      />
      <img
        className="profile-photo"
        src={image6}
        alt={"Carlie Anglemire"}
        height={"400px"}
      />
      <button style={{ padding: "15px, 32px" }} onClick={() => setIsDone(true)}>
        Done
      </button>
    </>
  );
}
